Mark Tenally/Associated PressNFL officiating veterans&nbsp;Ed Hochuli and&nbsp;Jeff Triplette are retiring, according to the league's senior vice president of officiating, Al Riveron, with&nbsp;Shawn Hochuli and Alex Kemp getting promoted to referee.
Shawn Hochuli is the son of Ed Hochuli.&nbsp;
Ed Hochuli, 67, has been an NFL official since 1990 and a&nbsp;crew chief for the past 26 seasons, working two Super Bowls in that time. He is perhaps most famous for being the league's most muscular referee and for his often detailed and lengthy explanations of penalty decisions.

Lindt has launched a new Classic Vegan range available in Australian supermarkets.
The new chocolate blocks come in two decadent and delicious flavours, Vegan Smooth and Vegan Hazelnut.&nbsp;
The dairy-free Swiss chocolate is made with oat powder and almond paste that replace the cow’s milk used to create the non-vegan blocks.&nbsp;
Lindt has launched a new Classic Vegan range that’s available in Australian supermarkets, the blocks come in two decadent flavours, Vegan Smooth and Vegan Hazelnut for $5.

